import React, { Component } from "react";
import Header from "./Components/Header";
import Members from "./Components/Members";
import Teams from "./Teams";

class App extends Component {
  constructor(props) {
    super(props);
  }

  select = (path) => {
    this.state = {
      members: Teams.all,
    };

    switch (path) {
      case "all":
        this.setState({ members: Teams.all });
        break;

      case "pwn":
        this.setState({ members: Teams.pwn });
        console.log(this.state);
        break;

      case "web":
        this.setState({ members: Teams.web });
        break;

      case "reversing":
        this.setState({ members: Teams.reversing });
        break;

      case "crypto":
        this.setState({ members: Teams.crypto });
        break;
    }
  };

  render() {
    return (
      <div className="App">
        <Header select={this.select.bind(this)}></Header>
        <Members members={this.state.members}></Members>
      </div>
    );
  }
}

export default App;
